import React, { Fragment } from 'react';
import Die from './die'


function Row({id,rowRolls}) {
    console.log(`printing row ${id} with ${rowRolls.length} columns`)

    let diceInRow = []
    let diceId = 0
    for (let [index, value] of rowRolls.entries()) {
        console.log(`sending die index ${index+1} letter ${value}` )
        diceId=index+1
        diceInRow.push(<Die key={id.toString()} id={diceId.toString()} roll={value}/>)
    }

    console.log(`diceInRow ${id}`, diceInRow)

    return (<td>diceInRow ${id}</td>)
}

export default Row
